    // useEffect(() =>{
    //     const { history } = props;

    // window.addEventListener("popstate", () => {
    //   history.go(1);
    // });
    // })
    
  
    return (
    <Router>
        {/* <Link to = "/home">Home</Link> */}

        
     
     <Switch>
         <Route exact path = '/' component = {Auth} /> 
         <Route exact path = '/home'  ><Protected component = {Home}/> </Route>
        
         
         
     </Switch>
     </Router>
      );
}


export default withRouter(App)
